CREATE VIEW [USUARIOSADMIN] as
SELECT usr.ID_EMPLEADO, usr.ID_USUARIO, usr.ADMINISTRADOR, emp.NOMBRE, emp.APELLIDOS, emp.TELEFONO, emp.CORREO
FROM [EMPLEADO] emp
INNER JOIN [USUARIOS] as usr on usr.ID_EMPLEADO = emp.ID_EMPLEADO
GO

CREATE VIEW [PROVEEDORYSUCURSAL] AS
SELECT PROVEEDOR.NOMBRE, SUCURSAL.NOMBRE_SUCURSAL
FROM PROVEEDOR
LEFT JOIN SUCURSAL ON PROVEEDOR.ID_PROVEEDOR = SUCURSAL.ID_PROVEEDOR
GO

CREATE VIEW [FECHAORDENCOMPRAPROVEEDOR] as 
SELECT PROVEEDOR.NOMBRE, ORDEN_COMPRA.FECHA_ORDEN_COMPRA
FROM PROVEEDOR
LEFT JOIN ORDEN_COMPRA ON PROVEEDOR.ID_PROVEEDOR = ORDEN_COMPRA.ID_PROVEEDOR
GO

CREATE VIEW [PRODUCTOSALMACEN] AS
SELECT PRODUCTO.NOMBRE_PRODUCTO, PRODUCTO.CONCENTRACIÓN, PRODUCTO.PRECIO, pad.CANTIDAD, pad.TOTAL
FROM PRODUCTO
RIGHT JOIN PRODUCTO_CANTIDAD AS pad ON pad.ID_PRODUCTO = PRODUCTO.ID_PRODUCTO
GO

CREATE VIEW [SUCURSALPROVEE] AS
SELECT COUNT(SUCURSAL.ID_SUCURSAL) AS 'SUCURSALES DISTRIBUIDORAS', COUNT(PROVEEDOR.ID_PROVEEDOR) AS 'PROVEEDORES SURTIDORES'
FROM PROVEEDOR
INNER JOIN SUCURSAL ON SUCURSAL.ID_PROVEEDOR = PROVEEDOR.ID_PROVEEDOR
GO

SELECT * 
FROM(
SELECT EMPLEADO.NOMBRE, EMPLEADO.APELLIDOS, EMPLEADO.CORREO, EMPLEADO.TELEFONO, PUESTO.TIPO, PUESTO.SUELDO
FROM PUESTO
INNER JOIN EMPLEADO ON EMPLEADO.ID_PUESTO = PUESTO.ID_PUESTO
)AS SEMIV
WHERE SEMIV.SUELDO > 800
GO

WITH SEMIV AS (
SELECT EMPLEADO.NOMBRE, EMPLEADO.APELLIDOS, EMPLEADO.CORREO, EMPLEADO.TELEFONO, PUESTO.TIPO, PUESTO.SUELDO
FROM PUESTO
INNER JOIN EMPLEADO ON EMPLEADO.ID_PUESTO = PUESTO.ID_PUESTO
)
SELECT *
FROM SEMIV
WHERE SEMIV.SUELDO > 800
GO

SELECT PROVEEDOR.NOMBRE, SUCURSAL.NOMBRE_SUCURSAL
INTO #TEMP
FROM [PROVEEDOR], SUCURSAL
WHERE PROVEEDOR.ID_PROVEEDOR = SUCURSAL.ID_PROVEEDOR
GO

UPDATE #TEMP
SET NOMBRE = 'GODINEZ', NOMBRE_SUCURSAL = 'BENAVIDES'
WHERE NOMBRE LIKE '%HERNANDEZ%'
